function handleEdit(){$("#formEditBarang").submit((function(e){e.preventDefault();const form=$(this),formData=new FormData(form[0]);let id=$("#idValue").val();$.ajax({type:"POST",url:HomeUrl+"/admin/barang/"+id,data:formData,processData:!1,contentType:!1,success:function(response){console.info(response),toastr.success("Data Berhasil Diperbaharui","Success"),setTimeout(()=>{window.location.href=HomeUrl+"/admin/barang"},6e3)},error:function(response){console.info(response),$.each(response.responseJSON,(function(key,value){toastr.error(value)}))}})}))}$(document).ready((function(){handleEdit()}));